import React, { Fragment } from "react";
import { Link, useParams, useRouteMatch } from "react-router-dom";

function NavBar({ OnClick, path, deckId, deckName, disabled }) {
  //const title = document.querySelector("h4");
  const params = useParams();
  const id = params.deckId;
  const { url } = useRouteMatch();
  let temp = null;
  /*const h2 =
    document.querySelector("h2").innerText === false
      ? "loading"
      : document.querySelector("h2").innerText;*/

  if (url.includes("study")) {
    temp = (
      <Fragment>
        <Link to="#" className="nav-link disabled">
          {" "}
          /{" "}
        </Link>
        <Link to="#" className="nav-link disabled">
          Study
        </Link>
      </Fragment>
    );
  }
  if (url.includes("edit")) {
    temp = (
      <Fragment>
        <Link to="#" className="nav-link disabled">
          {" "}
          /{" "}
        </Link>
        <Link to="#" className="nav-link disabled">
          Edit {/*h2 === "Edit Deck" ? "Deck" : "Card"*/}
        </Link>
      </Fragment>
    );
  }
  if (url.includes("cards/new")) {
    temp = (
      <Fragment>
        <Link to="#" className="nav-link disabled">
          {" "}
          /{" "}
        </Link>
        <Link to="#" className="nav-link disabled">
          Add Card
        </Link>
      </Fragment>
    );
  }

  return (
    <nav className="navbar navbar-expand navbar-light bg-light">
      <div className="container-fluid">
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <Link
              to="/"
              className="nav-link active"
              aria-current="page"
              id="navHome"
              onClick={OnClick}
            >
              Home
            </Link>
            <Link to="#" className="nav-link disabled">
              {" "}
              /{" "}
            </Link>
            <Link
              to={`/decks/${id}`}
              className={`nav-link active ${disabled ? "disabled" : null}`}
            >
              {/*title ? title.innerText : null*/}
              {/*path ? path : null*/}
              {deckName ? deckName : null}
            </Link>
            {temp}
          </div>
        </div>
      </div>
    </nav>
  );
}

export default NavBar;
